documentation.long:
Abstraction of the LEDs.

@author Jason Hill
@author David Gay
@author Philip Levis

Initialize the LEDs; among other things, initialization turns
them all off.

@return SUCCESS always.

Toggle the green LED. If it was on, turn it off. If it was off,
turn it on.

@return SUCCESS always.

Toggle the yellow LED. If it was on, turn it off. If it was off,
turn it on.

@return SUCCESS always.

Toggle the red LED. If it was on, turn it off. If it was off,
turn it on.

@return SUCCESS always.

documentation.short:
Set Leds to a specified value

@param value ranging from 0 to 7 inclusive

@return SUCCESS Always

documentation.long:
Stop the component and pertinent subcomponents (not all
subcomponents may be turned off due to wakeup timers, etc.).

@return Whether stopping was successful.

This interface provides a generic timer that can be used to generate
events at regular intervals.

@author Su Ping
@author Sam Madden
@author David Gay
